BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Campaign_Performance" (
	"campaign_id"	INTEGER,
	"total_sent"	INTEGER,
	"total_opens"	INTEGER,
	"total_clicks"	INTEGER,
	"total_unsubscribes"	INTEGER,
	PRIMARY KEY("campaign_id"),
	FOREIGN KEY("campaign_id") REFERENCES "Campaigns"("campaign_id")
);
CREATE TABLE IF NOT EXISTS "Campaigns" (
	"campaign_id"	INTEGER,
	"campaign_name"	TEXT,
	"send_date"	DATE,
	"email_subject"	TEXT,
	"send_hour"	INTEGER,
	"category"	TEXT,
	PRIMARY KEY("campaign_id")
);
CREATE TABLE IF NOT EXISTS "Email_Engagement" (
	"engagement_id"	INTEGER,
	"user_id"	INTEGER,
	"campaign_id"	INTEGER,
	"opened"	BOOLEAN,
	"clicked"	BOOLEAN,
	"unsubscribe"	BOOLEAN,
	"open_time"	DATETIME,
	PRIMARY KEY("engagement_id"),
	FOREIGN KEY("campaign_id") REFERENCES "Campaigns"("campaign_id"),
	FOREIGN KEY("user_id") REFERENCES "Users"("user_id")
);
CREATE TABLE IF NOT EXISTS "Question_1" (
	"total_unsubscribed"	INTEGER,
	"total_subscribers"	INTEGER,
	"unsubscribe_rate_percent"	NUMERIC
);
CREATE TABLE IF NOT EXISTS "Question_2" (
	"campaign_id"	INT,
	"total_emails_sent"	INTEGER,
	"total_unsubscribes"	INTEGER,
	"unsubscribe_rate_percentage"	NUMERIC
);
CREATE TABLE IF NOT EXISTS "Question_4_by_reason_and_category" (
	"COUNT(Unsubscribes.reason)"	INTEGER,
	"reason"	TEXT,
	"category"	TEXT
);
CREATE TABLE IF NOT EXISTS "Question_4_overall_case" (
	"reason_count"	INTEGER,
	"reason"	TEXT
);
CREATE TABLE IF NOT EXISTS "Unsubscribes" (
	"unsubscribe_id"	INTEGER,
	"user_id"	INTEGER,
	"campaign_id"	INTEGER,
	"unsubscribe_date"	DATE,
	"reason"	TEXT,
	PRIMARY KEY("unsubscribe_id"),
	FOREIGN KEY("campaign_id") REFERENCES "Campaigns"("campaign_id"),
	FOREIGN KEY("user_id") REFERENCES "Users"("user_id")
);
CREATE TABLE IF NOT EXISTS "Users" (
	"user_id"	INTEGER,
	"signup_date"	DATE,
	"device_type"	TEXT,
	"region"	TEXT,
	"is_active"	BOOLEAN,
	PRIMARY KEY("user_id")
);
CREATE TABLE IF NOT EXISTS "question_3" (
	"signup_date"	NUM,
	"unsubscribe_date"	NUM,
	"unsubscribes_user_id_column"	INT,
	"user_user_id_column"	INT,
	"unsubscribe_time"	INTEGER
);
COMMIT;
